def test_subtraction():
	assert format.binary32.sub(0x81000000, 0x80ffffff, format.binary32) == 0x80000000
	assert format.binary32.sub(0x81800000, 0x817fffff, format.binary32) == 0x80000000
	assert format.binary32.sub(0x2000000, 0x1ffffff, format.binary32) == 0x0
	assert format.binary32.sub(0x84000000, 0x83ffffff, format.binary32) == 0x80000000
	assert format.binary32.sub(0x847fffff, 0x84800000, format.binary32) == 0x0
